import React from "react";

const Login = ({ handleGoogleLogin }) => {
  return (
    <div className="login-container">
      <h2>Login</h2>
      <button className="btn btn-primary" onClick={handleGoogleLogin}>
        Login with Google
      </button>
    </div>
  );
};

export default Login;
